    <React.Fragment>
      &copy;Curb Appeal Landscapes {currentYear}{' '}
      <p>
        <strong>Call:</strong>{' '}
        <p>
          <a href='tel:+4257732818'>(425) 773-2818</a>
        </p>
      </p>
    </React.Fragment>
  );
};

export default Footer;
